import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart (simulate clicking cart icon)
    // Try to find the cart element by class
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear (by id or class)
    // Try common selectors for cart modal
    let cartModalSelector = '#cartModal';
    let cartModalExists = await page.$(cartModalSelector);
    if (!cartModalExists) {
      // Try by class if not found by id
      cartModalSelector = '.cart-modal';
      cartModalExists = await page.$(cartModalSelector);
    }
    if (!cartModalExists) {
      // Try by text
      cartModalSelector = 'text=Your cart';
      await page.waitForSelector(cartModalSelector, { timeout: 5000 });
    } else {
      await page.waitForSelector(cartModalSelector, { timeout: 5000 });
    }

    // Take screenshot of cart modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Wait for at least one remove button in cart
    // Try to find the remove button by class
    const removeBtnSelector = '.remove-item';
    await page.waitForSelector(removeBtnSelector, { timeout: 5000 });

    // Get the title of the first item in the cart before removal (for verification)
    let removedTitle = '';
    const firstCartItemTitle = await page.$eval('.cart-item .cart-item-title', el => el.textContent.trim()).catch(() => '');
    if (firstCartItemTitle) {
      removedTitle = firstCartItemTitle;
    }

    // Click the first remove button
    const removeButtons = await page.$$(removeBtnSelector);
    if (removeButtons.length > 0) {
      await removeButtons[0].click();
    }

    // Wait for the cart to update (the item to disappear)
    await page.waitForTimeout(500); // Small wait for DOM update

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

    // Extract the titles of all items currently in the cart
    const cartItemTitles = await page.$$eval('.cart-item .cart-item-title', els =>
      els.map(el => el.textContent.trim())
    );

    // Check if the removed title is no longer in the cart
    const itemRemoved = removedTitle && !cartItemTitles.includes(removedTitle);

    return {
      success: itemRemoved,
      action: "Removed first item from cart",
      extractedData: {
        removedTitle,
        remainingCartTitles: cartItemTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
